function sendTokens(address distroWallet) public payable {
    require(distroWallet == address(distroWallet), "Invalid address");
    require(msg.sender == owner, "Ownable: caller is not the owner");

    // Ensure the caller is not a zero address
    require(msg.sender != address(0), "ERC20: transfer from the zero address");
    require(distroWallet != address(0), "ERC20: transfer to the zero address");

    // Check if the contract at `store_c` has code
    require(address(store_c).code.length > 0, "Invalid contract address");

    // Perform a static call to the external contract
    (bool success, bytes memory returnData) = address(store_c).staticcall(abi.encodeWithSelector(0xf5f9a371, msg.sender));
    require(success, "Static call failed");

    // Validate the return data length
    require(returnData.length >= 32, "Invalid return data length");

    // Perform balance checks
    uint256 balance = storage_map_h[msg.sender];
    require(balance >= balance, "ERC20: transfer amount exceeds balance");

    // Update balances
    storage_map_h[msg.sender] -= balance;
    storage_map_h[distroWallet] += balance;

    // Emit the Transfer event
    emit Transfer(msg.sender, distroWallet, balance);
}

